import React from 'react'

function NotFound() {
  return (
    <div>
        <div className="container text-center py-5 my-5">
            <div className="display-4 pt-5 mt-5">
                <span className='text-danger'>Oops!</span> Page not found
            </div>
        </div>
    </div>
  )
}

export default NotFound;
